class ArticlePageController extends Component {
    constructor(props) {
        super(props);
        this.state ={
            isOpenSlider:true,
            activeBannerTab : 'forsale',
            data : null
        };

        // Variables

        // end Variable
        document.title = "Application Library";

    }

    componentDidMount() {
        fetch("http://localhost:8000/www/getarticledetail/docker-zero-to-advance")
        .then(res => res.json())
        .then(
          (result) => {
            //me.setState({
             //   "latestArticles":result.data.latestArticles
           // });
           this.setState({
               "data":result.data
           });
            this.props.parentmenucallback(result.data.category);
          },
          // Note: it's important to handle errors here
          // instead of a catch() block so that we don't swallow
          // exceptions from actual bugs in components.
          (error) => {
            this.setState({
              isLoaded: true,
            });
          }
        ) 
    }
}

export {ArticlePageController};
